          state_var_NS = while_C_0;
        end
        else begin
          state_var_NS = while_for_1_for_C_0;
        end
      end
      // while_C_0
      default : begin
        fsm_output = 9'b000000001;
        state_var_NS = while_C_1;
      end
    endcase
  end

  always @(posedge clk or negedge rst) begin
